    "store": {"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Dependencies\n    \n    \n        \n            @angular/animations : 11.2.11\n        \n            @angular/cdk : 11.2.10\n        \n            @angular/common : 11.2.11\n        \n            @angular/compiler : 11.2.11\n        \n            @angular/core : 11.2.11\n        \n            @angular/forms : 11.2.11\n        \n            @angular/material : 11.2.11\n        \n            @angular/material-moment-adapter : 11.2.10\n        \n            @angular/platform-browser : 11.2.11\n        \n            @angular/platform-browser-dynamic : 11.2.11\n        \n            @angular/router : 11.2.11\n        \n            bootstrap : ^3.3.7\n        \n            core-js : ^2.5.5\n        \n            jquery : ^3.3.1\n        \n            moment : ^2.29.2\n        \n            rxjs : ^6.3.1\n        \n            tether : ^1.4.4\n        \n            tslib : ^2.0.0\n        \n            zone.js : ~0.10.2\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nSpring Petclinic Angular\n\nAngular frontend for Spring Petclinic\nWarning: client only. \n  Use REST API from backend spring-petclinic-rest project\n  You need start backend server before start frontend application.\nScreenshot\n\nInstallation\n\nUpdate angular-cli to latest version (8.0.3 current)\nas described on angular-cli github readme.md\n\nnpm uninstall -g angular-cli @angular/cli\nnpm cache clean\nnpm install -g @angular/cli@latestClone project from github\ngit clone https://github.com/spring-petclinic/spring-petclinic-angular.gitInstall local project package\nnpm install --save-dev @angular/cli@latest\nif npm version > 5.0 delete package-lock.json file  ( bug in npm 5.0 - this file prevent correct packages install)\nnpm installNow project use Angular CLI v.8.0.3 and Angular v.8.0.1\nYou can see current dependencies in package.json file.\nDevelopment server\nRun ng serve for a dev server. Navigate to http://localhost:4200/. The app will automatically reload if you change any of the source files.\nCode scaffolding\nRun ng generate component component-name to generate a new component. You can also use ng generate directive|pipe|service|class|module.\nBuild\nRun ng build to build the project. The build artifacts will be stored in the dist/ directory. Use the -prod flag for a production build.\nYou can also build the application in a dedicated docker image using the provided Dockerfile as follows:\ndocker build -t spring-petclinic-angular:latest .Then you will be able to use it as follows:\ndocker run --rm -p 8080:8080 spring-petclinic-angular:latestDocumentation\nThe documentation of the Spring Petclinic Angular application is generated by the compodoc tool.\nDocumentation URL: https://spring-petclinic.github.io/spring-petclinic-angular/\nRegenerate the docs folder with compodoc:\ncompodoc -p src/tsconfig.app.json -d docsDeploy on Web servers\nDeploy on Nginx (for Nginx CentOS installation):\n\nBuild Angular application:\n\n  ng build --prod --base-href=/petclinic/ --deploy-url=/petclinic/\n\nCreate sub-directory /petclinic in default nginx directory /usr/share/nginx/html\n\nCopy /dist  sub-directory from Angular appication to  /usr/share/nginx/html/petclinic\n\nEdit nginx config (nginx.conf file in /etc/nginx/ directory)\n\n\nserver {\n    listen       80 default_server;\n        root         /usr/share/nginx/html;\n        index index.html;\n\n    location /petclinic/ {\n                alias /usr/share/nginx/html/petclinic/dist/;\n                try_files $uri$args $uri$args/ /petclinic/index.html;\n        }\n}\nReload nginx:  nginx -s reload\n\nRun app in brouser:  http://server_name/petclinic/\n\n\nDeploy on Apache (for Apache CentOS installation):\n\nBuild Angular application:\n\nng build --prod --base-href=/petclinic/ --deploy-url=/petclinic/\n\nCreate sub-directory /petclinic in default Apache directory /var/www/html\n\nGo into Angular appication /dist sub-directory and copy all files and sub-dirs from it to /var/www/html/petclinic\n\nEdit Apache config (/etc/https/conf/httpd.conf):\n\n\nsudo vi /etc/httpd/conf/httpd.conf\nFind the Directory /var/www/html> section and change the AllowOverride directive from None to All:\n /etc/httpd/conf/httpd.conf\n . . .\n  \n . . .\n # \n # AllowOverride controls what directives may be placed in .htaccess files.\n # It can be \"All\", \"None\", or any combination of the keywords:\n # Options FileInfo AuthConfig Limit\n #\n AllowOverride All\n . . .\n \n . . .\nSave and exit the file and then restart Apache to apply the change:\n\nsudo systemctl restart httpd\n\nCreate a .htaccess file in the directory /var/www/html/petclinic\n\nsudo vi /var/www/html/petclinic/.htaccess\nAdd the following line to the top of the file to activate the RewriteEngine, which instructs Apache to process any rules that follow:\nRewriteEngine On  \n# If an existing asset or directory is requested go to it as it is\nRewriteCond %{DOCUMENT_ROOT}%{REQUEST_URI} -f [OR]  \nRewriteCond %{DOCUMENT_ROOT}%{REQUEST_URI} -d  \nRewriteRule ^ - [L]\n\n# If the requested resource doesn't exist, use index.html\nRewriteRule ^ index.html  \nReload Apache:\n\nsudo systemctl restart httpd\n\nRun app in browser: http://server_name/petclinic/\n\nRunning unit tests\nRun ng test to execute the unit tests via Karma.\nRunning end-to-end tests\nRun ng e2e to execute the end-to-end tests via Protractor.\nBefore running the tests make sure you are serving the app via ng serve.\nFurther help\nTo get more help on the Angular CLI use ng help or go check out the Angular CLI README.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"properties.html":{"url":"properties.html","title":"package-properties - properties","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Properties\n    \n    \n        \n            Version : 11.2.11\n        \n            License : MIT\n    \n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
